## Moonlight Mountain Toadlet (*Capensibufo selenophos*)

::: left
Thirteen species were assessed for the first time (three assessed as EN, one as VU, four as NT, four as LC, and one as DD). Three of four previously DD species were assessed (one as EN and two as NT). This provides evidence that DD species are often more threatened than ‘data-sufficient’ species as proposed by Borgelt et al. 2022 and demonstrates the value of prioritizing DD species for funding and dedicated surveys. An example of this is the Moonlight Mountain Toadlet, *Capensibufo selenophos*. The Endangered Wildlife Trust secured funding to carry out extensive surveys between 2020 and 2023, and drive habitat protection processes with landowners. Seven previously unknown subpopulations of *C. selenophos* were confirmed across the
:::

::: right
![](./imgs/Capensibufo%20selenophos_Bionerds.png){style="width:100%; border-radius:10px;" fig-alt="Moonlight Mountain Toadlet Capensibufo selenophos ©Keir Lynch."}

[Moonlight Mountain Toadlet\* (*Capensibufo selenophos*) © Keir Lynch.]{style="font-size:75%; color:#626262;"}

Akkedisberg, Kleinrivier and Soetmuisberg Mountains in the Western Cape. Knowledge on threats was improved, and one property (approximately 700 ha) has been put forward for formal declaration through Biodiversity Stewardship and is being actively managed for control of alien invasive plants. This new information resulted in a non-genuine change from DD to EN based on an EOO of 478 km2, deterioration of habitat quality, and suspected declines.
:::
:::::

::::: {layout-ncol="2"}
## Boston Rain Frog (*Breviceps batrachophiliorum*)

::: left
An example of a newly described species being assessed is the hot-off-the-press Boston Rain Frog, *Breviceps batrachophiliorum* (du Preez et al. 2025), which was previously assessed as *B. bagginsi*. Based on morphological, call and genetic analyses, the new species has been redescribed and split, resulting in an assessment of Endangered for *B. batrachophiliorum* and Critically Endangered for *B. bagginsi*. This grassland-associated species is restricted to the
:::

::: right
![](./imgs/Breviceps%20batrachophiliorum_Louis%20du%20Preez.png){style="width:100%; border-radius:10px;" fig-alt="Boston Rain Frog *Breviceps batrachophiliorum* ©Louis Du Preez."}

[Boston Rain Frog *Breviceps batrachophiliorum* ©Louis Du Preez.]{style="font-size:75%;color:#626262;"}

midlands area in south central KwaZulu-Natal province. Records are confirmed from the Boston (type locality), Richmond, the Karkloof and Bulwer areas. Currently, the species is understood to occur at three subpopulations across less than 3000 km2.
:::
:::::

::::: {layout-ncol="2"}
## Table Mountain Ghost (*Heleophryne rosei*)

::: left
The Table Mountain Ghost Frog (*Heleophryne rosei*) provides an interesting example of how new information, and correct application of the IUCN Criteria and Categories, can impact the perceived extinction risk of a species. *Heleophryne rosei* has been listed as Critically Endangered for over 20 years, during which the same four threats have been implicated in reducing stream quality and extent. Despite this, there were no detailed studies undertaken to link specific threats to aspects of the species’ ecology to understand presumed declines and inform conservation actions. As such, the species remained listed as Critically Endangered because of on-going declines in habitat quality, small EOO, and one threat defined location. This began to change in 2019 when a multi-stakeholder project was launched to obtain fine-scale data on the species, increasing our understanding of magnitude and source of threats. While this habitat
:::

::: right
![](./imgs/sp_amphibian_img_2.png){style="width:100%; border-radius:10px;" fig-alt="Heleophryne-rosei"}

[The Table Mountain Ghost *Heleophryne rosei* ©Joshua Weeber.]{style="font-size:75%; color:#626262;"}

specialist is still extremely range-restricted and experiencing continued habitat loss, the project revealed that the location and source of known threats are diverse and the species is therefore considered to occur at 2-4 threat locations (different streams on Table Mountain). Data from this project are now being used to inform management frameworks for headwater mountain streams, emphasizing the importance of fine-scale studies in amphibian conservation in South Africa, and supporting the view that priority research needs to inform conservation of amphibians [@campbell2023a].
:::
:::::
::::::::::::

2.  Trends

The trend in species status over time was measured using the globally recognized indicator, the IUCN Red List Index of species (RLIs) [@butchart2004]. The RLIs are calculated based on genuine changes in Red List categories over time. The RLIs value ranges from 0 to 1, and the lower the value, the faster the taxonomic group is heading towards extinction – i.e. if the value is 1, all taxa are Least Concern, and if the value is 0, all taxa are extinct. The Red List Index of amphibians was calculated for all amphibian taxa that have been reassessed (n = 135).

Thirty-two species have had a change in status during the latest assessment (2016 to 2025). Only three species have had a genuine change in status (*Breviceps macrops* – desert rain frog (NT to VU), *Amietia hymenopus* - Phofung river frog (NT to VU) and *Hyperolius poweri* Power's reed frog (LC to NT). These three species are spatially isolated; however, they share some pressures, as both *Breviceps macrops* and *Amietia hymenopus* are likely to be impacted by climate change, where the former is restricted to the dry West Coast and relies on limited precipitation in the form of fog, and the latter occurs in streams along the Drakensberg Escarpment and Lesotho, which may face increased drying and extreme weather events. Both species are also impacted by the expansion of mining activities, *B. macros* specifically on the West Coast, due to the future planned development of the Green Hydrogen and *A. hymenopus* in the highlands of Lesotho into South Africa (@tbl-3). *Hyperolius poweri* has experienced a reduction in its range size due to the continued impacts of existing pressures and the intensification of urban coastal development, mining, afforestation, and agriculture (especially sugar cane plantations), which have caused wetland drainage and degradation through trampling from cattle.

The remaining thirty species that have had a change in their status were considered to be non-genuine changes due to new information, taxonomic changes, application of criteria, etc. There has been no improvement in status for amphibians during the assessment period. This is important to note: amphibians remain threatened by pressures that haven’t ceased and are increasing in most instances. Of particular concern are the impacts of invasive alien species, which affect 83% of threatened species, particularly in cases where the spread of invasive species is continuing or increasing. Impacts of this threat include drying out and replacement of habitat by alien invasive plants, diseases such as *chytridiomycosis*, and competition with problematic native species ([Box 2](#box-2)).

