3.  Pressures

Globally, habitat loss is the most common threat to amphibians, impacting 93% of threatened species, with agricultural expansion being the leading cause of habitat loss and degradation [@re2023a]. For South Africa’s frogs, the main pressures driving declines are impacts from invasive species, affecting 83% of threatened species threatened. These impacts include replacement of natural habitat due to expansion of woody invasive plants, drying out of wetlands and streams, changes to stream dynamics, including sedimentation, and alteration of natural fire regimes, and alteration of natural fire regimes.

::::::::::::::: {#box-2 .callout-note .species title="Box 2: Invasive species impacts on range-restricted." collapse="true"}
:::::: {layout-ncol="2"}
::: left
The Critically Endangered Rough Moss Frog, *Arthroleptella rugosa* is restricted to the Klein Swartberg Mountain in the Western Cape. Within less than a decade, large portions of its fynbos and seep habitat was invaded by Cluster Pines, *Pinus pinaster*. A study using bioacoustics to estimate frog densities found that numbers at invaded sites were directly affected by P. pinaster infestations [@angus2023a]. At invaded sites, call densities (and hence population numbers) were
:::

:::: right
![](./imgs/sp_amphibian_img_13.png){style="width:100%; border-radius:10px;" fig-alt="Arthroleptella rugosa"}

::: {style="font-size:80%; color:#626262; margin-right: -10px; line-height: 1.7;"}
© Alouis and Keir Lynch Bionerds
:::
::::
::::::

reduced, while at uninvaded sites call denisties were notable higher. This relationship held over time, with reduced call density recorded at sites with increasing invasion of alien Cluster Pines, and conversely an increase in call density at sites that became less invaded. These results confirm previous suggestions that invasive pine trees cause population declines in *A. rugosa*.

------------------------------------------------------------------------

:::::: {layout-ncol="2"}
::: left
These findings were used as motivation for conservation action and a joint initiative through CapeNature, the Endangered Wildlife Trust, Fynbos Trust, 18 landowners and the Klein Swartberg Conservancy, resulted in adaptive fire management to control pine invasion across the range. An ecological burn was carried out, which covered approximately 4000 hectares, and eradicated pines from areas where *A. rugosa* occurs. Post-fire monitoring has confirmed increasing numbers of frogs, and a 10-year management plan has been developed with the Conservancy, including ongoing alien plant management. This is a great example of conservation
