:::: {#box-3 .callout-note .species title="Box 3: The impact of habitat loss and degradation on South Africa’s amphibians" collapse="true"}
::: {.column width="100%"}
All 30 of South Africa’s threatened (CR, EN, VU) frog species are affected in one way or another by habitat loss and degradation (driven by agriculture, natural systems modifications, residential and commercial development, energy production and mining, and linear infrastructure for transportation and service corridors). As with global trends, agriculture is the main driver, impacting 77% of threatened species [@re2023a], while in South Africa agriculture impacts on 93% of threatened frog species. This includes impacts from livestock farming, including overgrazing, non-native tree plantations, non-timber crops, and erosion and siltation. System modifications include changes to fire frequency and intensity, water abstraction, and dam construction.

![](./imgs/sp_amphibian_img_14.png){fig-alt="Before ecological burn" style="width:100%; height:300px; object-fit:cover; border-radius:10px; margin-bottom:10px;"} [© Alouis and Keir Lynch Bionerds.]{style="width:75%; color:#626262;"}

------------------------------------------------------------------------

The Endangered Amathole Toad, *Vandijkophrynus amatolicus*, occurs in an area of the Eastern Cape highlands where original grassland habitat has been heavily transformed by both agriculture and timber production. However, working with livestock farmers to improve grazing management through regenerative agriculture approaches and facilitating habitat protection processes through Biodiversity Stewardship may prove beneficial to this toad, while supporting livelihoods within this strategic water source area.

![](./imgs/sp_amphibian_img_15.png){style="width:100%; height:auto; max-height:420px; object-fit:cover; border-radius:10px; color:grey;"} [The Western Leopard Toad (<i>Scelophrys pantherina</i>) © Luke Verburght.]{style="width:75%; color:#626262;"}
:::
::::

Habitat loss due to residential and commercial development impacts many of the country’s amphibians, perhaps none more so than the Western Leopard Toad (*Scelophrys pantherina*). Typically associated with low lying wetlands and vleis in the Western Cape province, the species has lost over 75% of suitable habitat predominantly due to urban infrastructure expansion, leading to several local extinctions and severe population declines throughout its range. Urban infrastructure in the form of roads also causes significant individual mortalities of breeding adults every year when toads move from their summer foraging grounds through now developed areas towards suitable breeding habitat.

Sightings (including roadkill) of this species by the public can be uploaded to iNaturalist, with sightings in the Overberg specifically to: https://www.inaturalist.org/projects/leopard-toads-of-the-overberg.

Contributions of occurrence records of any species are extremely valuable and have made up a significant proportion of data used in the current assessments (See [Box 4](@box-4)).

