## Protection level

The protection level assessment was conducted for 133 of South Africa’s 135 described amphibian species. Two peripheral taxa with less than 5% of their distribution in South Africa were excluded from the analysis. Protection level (PL) categories include ‘Poorly protected’, ‘Moderately Protected’, ‘Not Protected’ and ‘Well Protected’, Protection levels were calculated for amphibians by intersecting amphibian occurrence records with the protected area spatial layer, and calculating the area required to protect a target population of 10 000 individuals. Protection levels were also adjusted based on the management effectiveness of protected areas.


::: {.cell}
::: {.cell-output-display}
![Protection level for amphibians was assessed for 133 taxa. Analysis excluded peripheral taxa (those with less than 5% of distribution range occurring in South Africa); (A) shows the protection level for all taxa; (B) shows the protection level for South African endemics.](sp_amphibians_files/figure-html/fig-6-1.png){#fig-6 width=672}
:::
:::


Overall, the 2025 PL was higher than in 2016. While close to 72% of amphibians are considered well protected, 22% are poorly or not protected. Species-specific management within protected areas is generally lacking for amphibians, with7% (9 species) less well protected once we took PA management effectiveness into account. For the 75 endemic amphibians assessed, 57% are Well Protected, 17% (13 species) are Not Protected, and a further 17% (13 species) are Poorly Protected. Sixteen highly threatened (CR and EN) species are under-protected.


::: {.cell}
::: {.cell-output-display}
![The mosaic of wetland habitat at the Nuwejaars Wetlands Special Management Area where the Micro Frog, *Microbatrachella capensis* was discovered in 2021. Alien clearing efforts and population density estimates are currently underway using *M. capensis* as a management target. © Keir Lynch Bionerds.](./imgs/sp_amphibian_img_9.png){#fig-9 width=500px}
:::
:::


Nine species have had improvements in their protection level, from Poorly Protected to Moderately Protected (8 species) or Well Protected (1 species). Examples of threatened species that have benefitted from improved protection include the Endangered Micro Frog (*Microbatrachella capensis*), Pickersgill’s Reed Frog (*Hyperolius pickersgilli*), and the Cape Platanna (*Xenopus gilli*). In the case of *H. pickersgilli*, an additional 16 sites have been confirmed for the species since 2017, with several of these occurring within protected areas [@armstrong2025a]. Habitat protection gains have been a key outcome of the coordination of the Biodiversity Management Plan for this species, with several sites (totaling 127 hectares) being declared through the Biodiversity Stewardship Programme, as well as improved management and wetland health for these, and existing protected areas [@armstrong2025a]. For *M. capensis*, the confirmation of the species in the Nuwejaars Wetlands Special Management Area in 2021, which is now being managed with the frog as a management target, has resulted in both an expansion of the species’ range with Protected Areas, as well as improved management effectiveness scores from fair to good. It is important to recognize the contribution to the protected area estate that Biodiversity Stewardship and conservation servitudes (or OECMs) through agreements with landowners for targeting unprotected populations of species makes.


::: {.cell}
::: {.cell-output-display}
![The previously Critically Endangered Micro Frog, *Microbatrachella capensis*,  is now listed as Endangered due to its discovery at a new locality, it has also changed protection status from Poorly Protected to Moderately Protected resulting in a range extension. © Alouise Lynch Bionerds.](./imgs/sp_amphibian_img_10.png){#fig-10 width=500px}
:::
