## Species recovery

As part of the Red List process for southern Africa, the Amphibian Ark (AArk) joined the expert workshop and worked with the coordinators to produce a Conservation Needs Assessment [(CNA)](https://www.amphibianark.org/fileadmin/uploads/aark/CNA_Reports/AArk_South_Africa_CNA_report_july.pdf) for threatened South African amphibian species [@brunner2025a]. This used a process developed by AArk to determine which species have the most urgent conservation needs, based on action plans that combine in situ and ex situ actions, as appropriate. Six South African species were identified as needing ex situ conservation actions, including ex situ rescue (n = 5) and ex situ research (n = 1). Due to their level of threat, the five species recommended for ex situ rescue are also recommended for biobanking. Twenty-five species were recommended for in situ conservation, and 34 species are recommended for in situ research, while 15 species were identified for conservation education programs.

In addition, subsequent work to identify species requiring urgent recovery under Target 4 of the Global Biodiversity Framework resulted in 10 species being prioritised. This includes threatened endemic species and those of regional importance that might go extinct even if their habitat is protected. This speaks to the level of targeted management within protected areas that has not traditionally been focused on for amphibians and the need for research into responses to management interventions.

South Africa has a relatively proactive community working on amphibian conservation and research, with NGOs, provincial authorities and various universities contributing to building conservation evidence for assessing the effectiveness of conservation interventions and growing the body of knowledge on amphibian taxonomy, behavior and ecology (@tbl-3). This in part was guided by the conservation and research strategy compiled following the 2010 Red List assessments [@measey2011a], demonstrating the value of these processes, with plans in place to update this strategy following the most recent assessments. While good strides have been made, amphibian conservation capacity remains overlooked and underfunded compared to other taxa [@gu2025a], and this is particularly pertinent in the African context.


