::: {#box-5 .callout-note .species title="Box 5. Pickersgill’s reed frog: Conservation action at work" collapse="true"}
The example of coordinated conservation action for Pickersgill’s Reed Frog, *Hyperolius pickersgilli*, provides a good case study of a relatively long-term recovery project in which new knowledge has not only resulted in a threat status reduction (from Critically Endangered in 2010 to Endangered in 2016), but also in concerted efforts to understand and mitigate threats. Stemming from recommendations in the 2011 Strategy for Conservation Research [@measey2011a], a Biodiversity Management Plan (BMP) was co-developed between key stakeholders and has resulted in many achievements over the past decade, including improvements in knowledge of distribution, genetics and habitat requirements, implementation of monitoring protocols, a captive breeding program, improved habitat protection gains (including a biodiversity offset) and improved habitat management. Research related to the project was published in four peer-reviewed articles and has contributed to seven post-graduate studies. Of the 16 actions identified for the first iteration of the BMP, 17% had been completed, 65% were on track, 6% had minor issues, and a further 12% were still in the planning phase by 2022. Overall, 24 participating organizations have been involved, and implementation of actions resulted in direct employment of over 150 people across institutions as well as stimulating an influx of funding to support actions [@armstrong2025a]. In 2008 the species was known from less than 10 sites; today it is known to occur at almost 40 localities, and multiple breeding wetlands within these localities. The BMP helped strengthen government support as well as improved integration of research outputs into spatial planning and environmental compliance. Interest in the project also generated vast exposure, including television, signage and social media campaigns, reaching thousands of people. While this species’ range continues to be within an area of rapid transformation, this project that has resulted in the species improving its protection level from Poorly Protected in 2018 to Moderately Protected in 2025 demonstrates the successes that can be achieved through collaboration and the commitment of partners from a range of influences.

