## Knowledge gaps

While amphibians globally remain the most threatened (41%) vertebrates on Earth, basic data on species distribution, population numbers, and ecology remain poor. This is likely partly a result of limited funding, with amphibians receiving the least conservation funding of all major groups globally. Less than 2.8% of funding support is directed to amphibians globally, and this has declined from 4% in the 1990s [@gu2025a]. Projects on amphibians are also often focussed on multiple species, limiting investment per species. This differs from projects focussed on other taxa that often receive disproportional support, in some cases even for species that are not threatened (e.g., large mammals). This lack of funding is likely the root cause of several knowledge gaps discussed below and is also linked to inadequate capacity in amphibian research and conservation. These gaps are even more acute outside of South Africa in other parts of the continent.

Similarly, despite major efforts in recent decades to improve knowledge on amphibian declines, there remains a disconnect between research and translation of this into conservation actions. Research priorities identified at the global scale include better understanding of the effects of climate change, community-level drivers of declines, methodological improvements for research and monitoring, genomics, and effects of land-use change. Improved inclusion of under-represented members of the amphibian conservation community was also highlighted [@campbell2023a]. In South Africa, growing amphibian conservation and research capacity in a way that is representative is critical to addressing capacity gaps and providing skills transfer to young researchers to grow core conservation expertise.

Knowledge gaps related specifically to Red List processes for amphibians include that for most assessments, Criterion B (Geographic range information) is primarily used to inform assessments. Research projects that generate population data, both over time and in response to threats and management interventions will be useful to strengthen amphibian Red List assessments, and in turn to provide baseline data for adaptive conservation strategies. Using the outputs from Red Listing, including recommended conservation and research actions, is critical for prioritizing and guiding future conservation strategies, and such strategies have been found to be effective in improving taxonomy, ecological studies, monitoring, research outputs, and capacity building [@measey2019a].

## Approach

**Red List Assessment**

All previously assessed South African amphibians were reassessed as part of the Southern African Amphibian Red List Project (SAARLP) that commenced in 2023, as part the third global amphibian assessment process, supported by the IUCN Amphibian Specialist Group and Amphibian Red List Authority. 135 species were assessed for publication on the IUCN Red List in 2025 and 2026, including 11 newly described species since 2016 [@frost2025a]. Over 150,000 records were collated for the assessments, including from various institutions and verified citizen science data. Twenty experts representing thirteen organizations contributed to the assessment process.

**Protection Level Assessment**

The species protection level assessment measures how effectively South Africa’s protected area network safeguards a species. It evaluates progress towards achieving a “persistence target” for each species — the level of protection needed to support long-term population survival. Because persistence depends not only on the area protected but also on the ability of protected areas to reduce pressures that drive population decline, a protected area effectiveness factor is included in the calculation.

